<script>
export default {
  name: 'page-analysis',

  computed: {
    projects () {
      const projectNames = this.$api.project.getProjects.data.list.map(i => i.project.project_name).sort()

      return this.$api.project.getProjects.data.list.map(item => {
        item.project.developers = item.developers
        item.project.timeNodes = item.timeNodes
        item.project.delayDevelopers = item.developers.filter(item => item.delay > 0)
        return item.project
      }).sort((p1, p2) => {
        return projectNames.indexOf(p1.project_name) - projectNames.indexOf(p2.project_name)
      })
    },

    riskyProjects () {
      return this.projects.filter(item => item.status === 'risky')
    },

    nearProjects () {
      return this.projects.filter(item => {
        return new Date(item.next_time_node.start) - Date.now() < 24 * 60 * 60 * 1000 * 5
      })
    }
  },

  created () {
    const ym = this.$route.query.ym || `${this.$cnt.TIME_CUR_YEAR}-${this.$cnt.TIME_CUR_MONTH}`
    const userGroup = this.$app.user.userGroup || this.$ui.urlQuery.userGroup

    this.$api.project.getProjects.reset().send({
      status: 'doing',
      pageNo: '',
      pageSize: ''
    })

    this.$api.user.count.reset().send({
      groupId: userGroup
    })

    this.$api.global.time.send()
    this.$api.project.mounthTaskTime.send({ ym })
    this.$api.project.mounthProgress.send({ ym })
    this.$api.kpi.list.send({ ym, user_group: userGroup })
    this.$api.kpi.issues.send({ type: 'risk' })
  }
}
</script>

